import React from 'react';
import styled from '@emotion/styled';
import terminalpng from '../Images/terminal.png';
const TitleDiv = styled.div `
  z-index: -1;
  color: white;

  height: 100vh;
  width: 100%;
  display: inline-block;
  font-weight: 400;
  background-color: black;  
`;

const Terminal = styled.div`

`;


function Title() {
  return (
    <React.Fragment>
      <TitleDiv>
        <Terminal>
        </Terminal>

      </TitleDiv>
      
      
    </React.Fragment>
  );
}

export default Title;
